import React from "react";
import { Container } from "react-bootstrap";
import '../Styles/Header.css'
import Logo from '../img/logo.png'
import { BiSearchAlt } from "react-icons/bi";

export const Header = () => {
    return (
        <div className="header-container">
            <Container>
                <div style={{ height:'80vh',display: 'flex', justifyContent: 'space-between', padding: '5px' }}>
                    <div>
                        <img className="img-header" src={Logo} />
                        <a href="/" style={{textDecoration: 'none',color: '#fff',fontWeight: 'bold'}}>ArtConvites Design</a>
                    </div>
                    <div style={{display:'flex'}}>
                        <input type='text' className="form-control" placeholder="Pesquisar..."/>
                        <button className="btn btn-primary"><BiSearchAlt/></button>
                    </div>
                </div>
            </Container>
        </div>
    );
}
